// var each = require('../util/each');

/**
 *  binds  name  kebabcase  camelcase
 *
 * @param {Array} binds binds
 * @return {Array}
 */
function camelComponentBinds(binds) {
    var result = [];
    each(binds, function (bind) {
        result.push({
            name: kebab2camel(bind.name),
            expr: bind.expr,
            x: bind.x,
            raw: bind.raw
        });
    });

    return result;
}

